DROP TABLE IF EXISTS stellarClass;
CREATE TABLE stellarClass (
    spectralCategory VARCHAR(3) NOT NULL,
    stellarCategory VARCHAR(3) NOT NULL,
    temperatureKelvin FLOAT DEFAULT NULL,
    solarMass FLOAT DEFAULT NULL,
    solarLuminosity FLOAT DEFAULT NULL,
    solarDiameter FLOAT DEFAULT NULL,
    absoluteMagnitude FLOAT DEFAULT NULL,
    magnitudeCorrection FLOAT DEFAULT NULL,
    bolometricMagnitude FLOAT DEFAULT NULL,
    colorIndex FLOAT DEFAULT NULL,
    colorRGB VARCHAR(15) DEFAULT NULL,
    PRIMARY KEY (spectralCategory, stellarCategory)
)  ;


DROP TABLE IF EXISTS stellarParameters;
CREATE TABLE stellarParameters (
    designation VARCHAR(45) NOT NULL,
    identifierHD VARCHAR(10) DEFAULT NULL,
    identifierHIP VARCHAR(10) DEFAULT NULL,
    identifierSAO VARCHAR(10) DEFAULT NULL,
    radialVelocity FLOAT DEFAULT NULL,
    parallax FLOAT DEFAULT NULL,
    parsecs FLOAT DEFAULT NULL,
    lightYears FLOAT DEFAULT NULL,
    apparentMagnitude FLOAT DEFAULT NULL,
    absoluteMagnitude FLOAT DEFAULT NULL,
    bolometricMagnitude FLOAT DEFAULT NULL,
    solarDiameter FLOAT DEFAULT NULL,
    absoluteLuminosity FLOAT DEFAULT NULL,
    bolometricLuminosity FLOAT DEFAULT NULL,
    solarMass FLOAT DEFAULT NULL,
    innerBoundary FLOAT DEFAULT NULL,
    outerBoundary FLOAT DEFAULT NULL,
    gregorianYear FLOAT DEFAULT NULL,
    spectralCategory VARCHAR(3) DEFAULT NULL,
    stellarCategory VARCHAR(3) DEFAULT NULL,
    PRIMARY KEY (designation),
    FOREIGN KEY (spectralCategory, stellarCategory)
        REFERENCES stellarClass (spectralCategory, stellarCategory)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ;


DROP TABLE IF EXISTS stellarName;
CREATE TABLE stellarName (
    designation VARCHAR(45) NOT NULL,
    denomination VARCHAR(255) DEFAULT NULL,
    PRIMARY KEY (designation),
    FOREIGN KEY (designation)
        REFERENCES stellarParameters (designation)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ;

